export const modificaEmail1 = (texto) => {
    return {
        type: 'modifica_email1',
        dadoParaOReducer: texto
    }
}

export const modificaSenha1 = (texto) => {
    return {
        type: 'modifica_senha1',
        dadoParaOReducer: texto
    }
}
